import React, { useState, useEffect } from "react"
import apiService from "../services/api"
import LogFilter from "./LogFilter"
import './loglist.css'

const LogList = ({ startDate, endDate, keyword}) => {
   const [logs, setLogs] = useState([])
   const [filteredLogs, setFilteredLogs] = useState([])

   useEffect(() => {
      fetchLogs()
   }, [])

   const fetchLogs = async () => {
      try{
         const logsData = await apiService.getLogs()
         setLogs(logsData)
      } catch (error) {
         console.error('Error fetching logs:', error)
      }
   }

   const convertDateFormat = (dateString) => {
      const [day, month, year] = dateString.split('/')
      return `${year}-${month}-${day}`
   }

   const isValidDate = (dateString) => {
      const regex = /^\d{4}-\d{2}-\d{2}$/
      const isValid = dateString.match(regex) !== null
      if (!isValid) {
         console.error('Data inválida:', dateString)
      }
      return isValid
   }

   const handleFilter = async (startDate, endDate, keyword) => {
      if (isValidDate(startDate) && isValidDate(endDate)) {
         const formattedStartDate = new Date(startDate).toISOString().split('T')[0]
         const formattedEndDate = new Date(endDate).toISOString().split('T')[0]

         try {
            let logsData

            if (keyword) {
               logsData = await apiService.getLogs({
                  start_date: formattedStartDate,
                  end_date: formattedEndDate,
                  keyword,
               })
            } else {
               logsData = await apiService.getLogsByDate({
                  start_date: formattedStartDate,
                  end_date: formattedEndDate,
               })
            }
            setFilteredLogs(logsData)
            console.log(logsData)
         } catch (error) {
            console.error("Error filtering logs", error)
         }
      } else {
         console.error('Datas inválidas')
      }
   }

   const handleFilterClick = () => {
      const startDate = startDateInput.value; // Substitua 'startDateInput' pelo ID ou referência ao campo de entrada de data inicial
      const endDate = endDateInput.value; // Substitua 'endDateInput' pelo ID ou referência ao campo de entrada de data final

      if (startDate && endDate) {
         console.log('startDate:', startDate);
         console.log('endDate:', endDate);

         const formattedStartDate = convertDateFormat(startDate);
         const formattedEndDate = convertDateFormat(endDate);
         handleFilter(formattedStartDate, formattedEndDate, keyword);
      } else {
         console.error('Datas inválidas');
      }
   };

   const isValidTime = (time) => {
      const timeRegex = /^([01]\d|2[0-3]):([0-5]\d):([0-5]\d)$/
      return timeRegex.test(time)
   }

   const formatTime = (time) => {
      const [hours, minutes, seconds] = time.split(':')
      return `${hours}:${minutes}:${seconds}`
   }

   return (
      <div className="log-list">
         <h1>Log List</h1>
         <LogFilter handleFilter={handleFilterClick} />
         <div className="log-cards">
            {filteredLogs && filteredLogs.length > 0 ? (
               filteredLogs.map((log) => (
               <div key={log._id} className="log-card">
               <p><b>ID:</b> {log._id}</p>
               <p><b>IP:</b> {log.ip_address}</p>
               <p><b>Date:</b> {new Date(log.date).toLocaleDateString('pt-BR')}</p>
               <p><b>Time:</b> {isValidTime(log.time) ? formatTime(log.time) : 'Invalid Time'}</p>
               <p><b>Username:</b> {log.username}</p>
               <p><b>Version:</b> {log.version}</p>
               <p><b>Document:</b> {log.document}</p>
               <p><b>Description:</b> {log.description}</p>
               </div>
            ))
         ) : (
            logs.map((log) => (
               <div key={log._id} className="log-card">
               <p><b>ID:</b> {log._id}</p>
               <p><b>IP:</b> {log.ip_address}</p>
               <p><b>Date:</b> {new Date(log.date).toLocaleDateString('pt-BR')}</p>
               <p><b>Time:</b> {isValidTime(log.time) ? formatTime(log.time) : 'Invalid Time'}</p>
               <p><b>Username:</b> {log.username}</p>
               <p><b>Version:</b> {log.version}</p>
               <p><b>Document:</b> {log.document}</p>
               <p><b>Description:</b> {log.description}</p>
               </div>
            ))
         )}
         </div>
      </div>
   )
}

export default LogList
